import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Netflix';

import "./App.css";
import Sdata from './Sdata';

ReactDOM.render(

 <>
    <Card
       imgsrc={Sdata[0].imgsrc}
       title={Sdata[0].title}
       sname={Sdata[0].sname}
       link={Sdata[0].link}
    />

<Card
       imgsrc="./img/dark.jpg"
       title="A Netflix Orignal Series"
       sname="Dark"
       link=""
    />

<Card
       imgsrc="./img/dark.jpg"
       title="A Netflix Orignal Series"
       sname="Dark"
       link=""
    />
 </>
  ,
  document.getElementById('root')
);
